import React from 'react'
import { useTeaserPropertiesQuery, PropObject } from '../../generated/graphql'
import { LoadingAnimation } from '../elements/LoadingAnimation';
import { ErrorView } from '../elements/ErrorView';
import { Button } from '@material-ui/core';

interface Props {
    onPropertySelected: (property: PropObject) => void; 
}

export const PropertyList: React.FC<Props> = (props) => {

    const {data, loading, error} = useTeaserPropertiesQuery();


    if(loading){
        return (
            <LoadingAnimation />
        )
    }

    if(error){
        return (
            <ErrorView error={error}/>
        )
    }

    if(data && data.teaserProperties){
        return(
            <div>
                <ul>
                {data?.teaserProperties.map(x => {
                return <li key={x.id}> {x.id}, {x.title}, {x.location} 
                    <Button onClick={() => {props.onPropertySelected(x)}}>ausw√§hlen</Button></li> })
                }
                </ul>              
            </div>
        )

    }

    return (
        <LoadingAnimation />  
    )
}
